import { Tokenomic } from "./pages/tokenomic/Tokenomic";
import { Roadmap } from "./pages/roadmap/Roadmap";
import { Partner } from "./pages/partner/Partner";
import { Footer } from "./pages/footer/Footer";
import { useMediaQuery } from 'react-responsive';

function App() {  
  const isDesktop = useMediaQuery({ minWidth: 1024 });
  const backgroundImageClass = isDesktop ? 'bg-[cover]' : 'bg-[contain]';
  return (
    <main className="bg-heroBg bg-no-repeat bg-cover w-[1920px]">
      {/* className="bg-heroBg bg-no-repeat bg-cover w-full" */}
      <Navbar/>
      <Hero />
      <Intro />
      <Tokenomic />
      <Howto/>
      <Roadmap/>
      <Partner />
      <Footer/>
    </main>
    // <Routes>
    //   <Route path="/" element={<Slide1691 />} />
    // </Routes>
  );
}
export default App;
